import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 293.34,
      date: new Date(2023, 2, 28),
    },
    {
      id: "e2",
      title: "Groceries",
      amount: 193.34,
      date: new Date(2023, 4, 28),
    },
    {
      id: "e3",
      title: "Health",
      amount: 5693.34,
      date: new Date(2023, 5, 18),
    },
    {
      id: "e4",
      title: "Fitness",
      amount: 233.34,
      date: new Date(2023, 3, 8),
    },
  ];
  return (
    <div>
      <h2>Let's get started right now!</h2>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[2].title}
        amount={expense[2].amount}
        date={expense[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[3].title}
        amount={expense[3].amount}
        date={expense[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
